import React from "react";
import { Routes, Route } from "react-router-dom";
import JiraManagerPro from "./project"; // tickets page
import AnalyticsDashboard from "./AnalyticsDashboard"; // dashboard page

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <Routes>
        {/* Default route = Tickets UI */}
        <Route path="/" element={<JiraManagerPro />} />

        {/* Analytics Dashboard */}
        <Route path="/analytics" element={<AnalyticsDashboard />} />
      </Routes>
    </div>
  );
}

export default App;
